import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Assuming these are the components you want to render for different routes
import Home from './components/Home'; // Update this if your component file path is different
import About from './components/About'; // Update this if your component file path is different

function App() {
  return (
    <Router>
      <Routes>
        {/* Define the routes */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </Router>
  );
}

export default App;
